  null,\n\t\"notes\": \"The nearshore sensors are part of the Pacific Islands Ocean
  Observing System (PacIOOS) and are designed to measure a variety of ocean parameters
  at fixed point locations along the south shore of Oahu. NS16 is located off Wailupe
  in Maunalua Bay in Aina Haina. The instrument is a Sea-Bird Electronics model 16+
  V2 coupled with a WET Labs ECO-FLNTUS combination sensor. The package is fixed to
  the pier at about 1m depth.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
